import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const displayProperty = (property) => {
    return (
        <>
        <div className="hero is-small">
            <div className="hero-body">

            </div>
        </div>

        <div className="card">
            <div className="media">
                <div className="media-left">
                    <figure className="image is-128x128">
                        <img src={"http://127.0.0.1:8000/" + property.main_pic} alt="" />
                    </figure>
                </div>
            </div>

            <div className="card-content">
                <div className="content">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus nec iaculis mauris.
                <a href="#">@bulmaio</a>. <a href="#">#css</a> <a href="#">#responsive</a>
                <br/>
                <time datetime="2016-1-1">11:09 PM - 1 Jan 2016</time>
                </div>
            </div>
            <footer className="card-footer">
                <a href="#" className="card-footer-item">Save</a>
                <a href="#" className="card-footer-item">Edit</a>
                <a href="#" className="card-footer-item">Delete</a>
            </footer>
        </div>
        </>
    );
};

const MyPropertyList = () => {
    const [properties, setProperties] = useState([]);
    const [userID, setUserID] = useState(-1);
    const navigate = useNavigate();

    useEffect(() => {
        
        // get the user id
		fetch("http://127.0.0.1:8000/accounts/info/",{
            method: 'GET',
            headers: {
                'Authorization': 'Bearer ' + localStorage.getItem('token')
            }
        })
        .then((response) => response.json())
        .then((data) => {
            setUserID(data.id);
        }
        ).then(() => {
            if (userID === -1) {
                return ;
            }

            // get the properties that belong to the user
            fetch("http://localhost:8000/property/list/?owner=" + userID, {
                method: 'GET',
                headers: {
                    'Authorization': 'Bearer ' + localStorage.getItem('token')
                }
            })
            .then((response) => response.json())
            .then((data) => {
                setProperties(data.properties);
            }
            );
        });
    }, [userID]);


    console.log(properties);
    const displayProperties = properties.map((property) => {
        console.log("A");
        console.log(property);
        return displayProperty(property);
    });

    return (
        <>
            <div className="container">
                {displayProperties}
            </div>
        </>
    );
};

export default MyPropertyList;
